package com.realmax.cars.bean;

/**
 * @ProjectName: Cars
 * @Package: com.realmax.cars.bean
 * @ClassName: BodyBean
 * @CreateDate: 2020/3/16 13:14
 */
public class BodyBean {

    /**
     * cmd : play
     * deviceType : 小车
     * deviceId : 1
     * cameraNum : 1
     * cameraImg : 
     */

    private String cmd;
    private String deviceType;
    private int deviceId;
    private int cameraNum;
    private String cameraImg;

    public String getCmd() {
        return cmd;
    }

    public void setCmd(String cmd) {
        this.cmd = cmd;
    }

    public String getDeviceType() {
        return deviceType;
    }

    public void setDeviceType(String deviceType) {
        this.deviceType = deviceType;
    }

    public int getDeviceId() {
        return deviceId;
    }

    public void setDeviceId(int deviceId) {
        this.deviceId = deviceId;
    }

    public int getCameraNum() {
        return cameraNum;
    }

    public void setCameraNum(int cameraNum) {
        this.cameraNum = cameraNum;
    }

    public String getCameraImg() {
        return cameraImg;
    }

    public void setCameraImg(String cameraImg) {
        this.cameraImg = cameraImg;
    }

    @Override
    public String toString() {
        return "BodyBean{" +
                "cmd='" + cmd + '\'' +
                ", deviceType='" + deviceType + '\'' +
                ", deviceId=" + deviceId +
                ", cameraNum=" + cameraNum +
                ", cameraImg='" + cameraImg + '\'' +
                '}';
    }
}
